// index.js
import React from "react";
import ReactDOM from "react-dom";
import App from "./App"; // 导入 App 组件
//import "./index.css"; // 引入样式文件（如果有）
import './output.css'; // 引入 Tailwind CSS

//index.js 是应用的入口点，负责加载和渲染 App 组件。是App.js的底层
// 渲染 App 组件到 HTML 文档中的根节点
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root") // 假设 HTML 中有一个 id 为 root 的元素
);
